Биатлон+ для iOS - это все новости, интересные тексты и интервью о биатлоне #прямосейчас, а также платформа для общения с другими болельщиками.  Текстовые онлайн трансляции, календарь гонок и детальная статистика обязательно появятся в следующих версиях приложения.

В текущей версии приложения вы найдете:

• Новости, анонсы, тексты лучших спортивных журналистов и интервью о биатлоне;
• Гонки, таблицы и статистика;
• Блоги и материалы пользователей Sports.ru;
• Фото;
• Общение с другими болельщиками.
